     * Everything below preserves “no-op” / always-true checks that were
     * present in the decompiled byte-code.  They do **nothing** at run-
     * time but must remain for logical fidelity with the original blob.
     * ------------------------------------------------------------------
     */
    require(uint256(9) != 0, "ERC20: approve to the zero address");
